import { NavLink, Outlet } from "react-router-dom";

const RootLayout = () => {
    return (
        <>
            <nav className="bg-gray-200 rounded-md p-3 flex mx-2 justify-between">
                <NavLink to="/" className="flex-1">الشراء</NavLink>
                <NavLink to="sales" className="block" >المبيعات</NavLink>
            </nav>
            <main>
                <Outlet />
            </main>
        </>
    );
}

export default RootLayout;
